import React from 'react';
import { StyleSheet, Text, View,Button} from 'react-native';
import {WebView } from 'react-native-webview';
import {HeaderButtons , Item } from 'react-navigation-header-buttons'
import NavButton from '../components/NavButton'

const Video = (props) => {
  const video=props.navigation.getParam("video")
 
  return (
    <View style={stil.ekran}>
      <Button title= 'Natrag' onPress={()=> { 
        props.navigation.navigate('JednaKategorija') }}
      />
       <WebView
        style={{ marginTop: 20, width: 320, height: 230 }}
        javaScriptEnabled={true}
        domStorageEnabled={true}
        source={{ uri: `https://www.youtube.com/embed/${video}` }}
        />

        <Button title= 'Odjava' 
        onPress={()=> { props.navigation.navigate('Login') }}/>
        </View>
  );
}

Video.navigationOptions = (navdata) => {
 const naziv=navdata.navigation.getParam("naziv")
 const headerRightFunc = () => {
  return(
  <HeaderButtons HeaderButtonComponent={NavButton}>
    <Item
    title='Favorit' 
    iconName='ios-star'
    onPress={()=>{
      console.log('Vjezba u favoritima.')
    }}
    />
  
  </HeaderButtons>
  );
  
}
 return {
    headerTitle: naziv,
    headerRight: (headerRightFunc)

    }
  }
 
const stil = StyleSheet.create({
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default Video
